define({"topics" : [{"title":"Check in","shortdesc":"\n                     <p class=\"shortdesc\">Check-in is a process of writing the changes made to the local working copy of       a file back into the repository.</p>\n                  ","id":"Project_items_check_in","href":"TA_Help\/Topics\/Project_items_checkin.html","menu": {"hasChildren":false,},"tocID":"Project_items_check_in-d46e21135","topics":[]},{"title":"Check out","shortdesc":"\n                     <p class=\"shortdesc\">Check-out is the process of creating a local working copy from the       repository.</p>\n                  ","id":"Project_items_check_out","href":"TA_Help\/Topics\/Project_items_checkout.html","menu": {"hasChildren":false,},"tocID":"Project_items_check_out-d46e21146","topics":[]},{"title":"Undo check out","shortdesc":"\n                     <p class=\"shortdesc\">Undoing checkout allows you discard any changes you have made to local copies of project   items and check them back in to\n                        the repository. \n                     </p>\n                  ","id":"Project_items_undo_check_out","href":"TA_Help\/Topics\/Project_items_undo_checkout.html","menu": {"hasChildren":false,},"tocID":"Project_items_undo_check_out-d46e21157","topics":[]},{"title":"Revision history","shortdesc":"\n                     <p class=\"shortdesc\">The <span class=\"ph\">TestArchitect</span> repository saves pertinent information   on a project item every time the item is checked in. This includes timestamp, assigned\n                        version,   project name, item type (test modules, data sets, actions, etc.), item name, user who checked in   the item, and\n                        included comments.\n                     </p>\n                  ","id":"Project_items_history","href":"TA_Help\/Topics\/Project_items_history.html","menu": {"hasChildren":false,},"tocID":"Project_items_history-d46e21168","next":"Project_items_history-d46e21168",}]});